import React from 'react';
import './css/friends.css';

const Friends = () => {
    return (
        <div>
            <section>
                <div><p className='select amigos'>Amigos</p> <p>X</p></div>
                <div><p className='select nitro'>Nitro</p> <p>X</p></div>
                <div><p>Mensagem Direta</p> <p>X</p></div>
            </section>
        </div>
    )
}

export default Friends;
